class Cookies{static set(t,e,l=7){let i="";if(l){let s=new Date;s.setTime(s.getTime()+864e5*l),i="; expires="+s.toUTCString()}document.cookie=t+"="+e+i+"; path=/"}static get(t){let e=document.cookie.split(";");for(let l=0;l<e.length;l++){let i=e[l].trim();if(i.startsWith(t+"="))return i.substring(t.length+1,i.length)}}static getAll(){let t=document.cookie.split(";"),e={};for(let l=0;l<t.length;l++){let i=t[l].trim(),s=i.split("=")[0];e[s]=i.substring(s.length+1,i.length)}return e}static delete(t){gCookie.set(t,"",-1)}static destroy(){let t=gCookie.getAll();for(let e in t)gCookie.delete(e)}}